import React from 'react'
import { PiFlowerTulip } from "react-icons/pi";
import { GiFlowerPot } from "react-icons/gi";
import svgSrc from '../../public/img/svg/icon-tulips'

const Sec02 = () => {
  return (
    <div className='section-container'>
      <div className='margin2'></div>
      <img src={svgSrc} alt="" />
      {/* <PiFlowerTulip className='icon' size='20' color='#ff0000'/> */}
      {/* <GiFlowerPot size='50' className='icon'/> */}
      {/* <img src="./img/svg/tulip.svg" alt="" className='icon'/> */}
      {/* <img src="./img/icon/icon-tulips.png" alt="" width='40vw' /> */}
      <div className='margin3'></div>
      <span className='font3'>서로의 이름을 부르는 것만으로도</span>
      <div className='margin5'></div>
      <span className='font3'>사랑의 깊이를 확인할 수 있는 두 사람이</span>
      <div className='margin5'></div>
      <span className='font3'>꽃과 나무처럼 걸어와서</span>
      <div className='margin5'></div>
      <span className='font3'>서로의 모든 것이 되기 위해</span>
      <div className='margin5'></div>
      <span className='font3'>오랜 기다림 끝에 혼례식을 치르는 날</span>
      <div className='margin5'></div>
      <span className='font3'>세상은 더욱 아름다워라</span>
      <div className='margin3'></div>
      <span className='font3'>이해인, {'<사랑의 사람들이여>'} 중</span>
      <div className='margin2'></div>
    </div>
  )
}

export default Sec02
